var termsConditions = ["Sizga ushbu TV qurilma (bu \"Qurilma\") orqali taqdim etilgan kontentlar va xizmatlar (birgalikda \"Litsenziyalangan ilova\" deb ataladi) sotilmaydi, balki faqat ushbu shartlar asosida foydalanishingiz uchun litsenziya asosida taqdim etiladi. Litsenziyalangan ilova ta‘minotchilari (har biri \"Ilova ta‘minotchisi\" deb ataladi) sizga yaqqol tarzda berilmagan huquqlarni o‘zlarida saqlab qoladilar. \n 1.Litsenziya ko‘lami \n Tegishli Ilova ta‘minotchisi tomonidan Litsenziyalangan ilova uchun sizga taqdim etilgan litsenziya o‘zingiz egalik qiladigan yoki boshqaradigan Qurilmada Litsenziyalangan ilovadan foydalanish bo‘yicha cheklangan o‘tkazib bo‘lmas litsenziyadir. Sizning Litsenziyalangan ilovani tarqatishingiz yoki bir nechta qurilmalar tomonidan bir vaqtda foydalanilishi mumkin bo‘lgan tarmoq orqali foydalaniladigan qilishingiz mumkin emas. Siz Litsenziyalangan ilovani ijaraga, lizingga bera, sota, tarqata yoki ikkilamchi lizingga bera olmaysiz. \n Siz barcha Litsenziyalangan ilova va unga kiritilgan ushbu Qurilma orqali foydalanish mumkin bo‘lgan barcha kontentlarning Ilova ta‘minotchisiga tegishli ekanligini va tegishli aqliy mulkchilik to‘g‘risidagi qonunlar bilan himoya qilinishini tan olasiz va bunga o‘z roziligingizni bildirasiz. Sizga ushbu Litsenziyalangan ilova yoki uning yangilanishlari yoki qismlarini moslashtirish, nusxa ko‘chirish, dekompilyatsiya qilish, qismlarga ajratib buzish, Qayta chop qilish, yuklab qo‘yish, o‘tkazish, tarjima qilish, kodlarini olishga urinish, ushbu dasturiy ta‘minotga asoslangan holda hosilaviy mahsulotlarni yaratish yoki boshqa tarzda foydalanishga ruxsat berilmaydi. Agar ushbu cheklanishni buzsangiz, sizga nisbatan sud ishi ko‘rilishi yoki zararlarni qoplab berish talab qilinishi mumkin. Litsenziya shartlari Ilova ta‘minotchisi tomonidan taqdim etilgan asl Litsenziyalangan ilovaning o‘rnini oluvchi va/yoki uni to‘ldiruvchi har qanday yangilanishlarga nisbatan qo‘llaniladi, bunday yangilanish alohida litsenziya bilan berilgan hollar bundan mustasno, bu holda o‘sha litsenziya shartlari qo‘llaniladi. Litsenziyalangan ilovani yangilash bo‘yicha har qanday va barcha harajatlar (agar ular mavjud bo‘lsa) uchun faqat o‘zingiz javobgar hisoblanasiz. \n 2.Boshqalarning materiallari \n  Litsenziyalangan ilova Ilova ta‘minotchisi yoki boshqalarning xizmatlari va veb-saytlariga (birgalikda \"Xizmatlar\" deb ataladi) kirishga imkon berishi mumkin. Siz Xizmatlardan istalganidan foydalanish orqali ochiq tilga ega yoki ega emas deb tan olinishi mumkin bo‘lgan haqoratlovchi, hayosiz yoki yoqimsiz deb topilishi mumkin bo‘lgan kontentlarga duch kelishingiz va har qanday qidirish natijasi yoki ma‘lum URL ni kiritishning avtomatik ravishda istalmagan materialga bo‘lgan ulanmalar yoki havolalarni yaratishi mumkinligini tushunasiz. Shunga qaramasdan siz haqoratli, hayosiz yoki yoqimsiz deb topilishi mumkin bo‘lgan kontentlar uchun ushbu Qurilma ishlab chiqaruvchisi (bundan buyon - \"Ishlab chiqaruvchi\") va Ilova ta‘minotchisining sizning oldingizda javobgar emasligiga o‘z roziligingizni bildirasiz.\nXizmatlardan foydalanish orqali siz bunday Xizmatlarning tarkibi, aniqligi, to‘liqligi, o‘z vaqtidaligi, mualliflik huquqlariga amal qilishi, qonuniyligi, sifati yoki boshqa jihatini tekshirish yoki baholash Ishlab chiqaruvchining javobgar emasligini tan olasiz va bunga o‘z roziligingizni bildirasiz. Ishlab chiqaruvchi har qanday Xizmat uchun siz yoki boshqa har qanday shaxs oldida javobgarlik yoki ma‘suliyatni o‘z zimmasiga olmaydi, olishini ta‘kidlamaydi, olishi nazarda tutilmaydi yoki javobgarlikka ega bo‘lmaydi. \n Siz Xizmatlarning tegishli mulkchilik to‘g‘risidagi va boshqa qonunlar bilan himoya qilinuvchi shaxsiy kontentlar, ma‘lumotlar va materiallarni (umumiy holda \"Boshqalarning materiallari\" deb ataladi) o‘z ichiga olishi mumkinligi va bunday Boshqalarning materiallardan Xizmatlardan ruxsat berilgan foydalanish usullaridan boshqa usullarda foydalanmaslikni tan olasiz va bunga o‘z roziligingizni bildirasiz. Siz Boshqalarning materiallarini qaytadan yaratmaslik, moslashtirmaslik, ijaraga, lizingga, qarzga bermaslik, sotmaslik, tarqatmaslik yoki istalgan tarzda ular asosida hosilaviy ishlar yaratmaslikka o‘z roziligingizni bildirasiz va Xizmatlardan har qanday ruxsat berilmagan usulda foydalanmaysiz. Siz yana Xizmatlardan boshqalarni haqoratlash, qo‘rqitish, tahdid qilish, sha‘niga dog‘ tushirish yoki boshqa tarzda boshqalarning huquqlarini buzish uchun foydalanmaslikka va Ishlab chiqaruvchining siz tomoningizdan qilingan bunday foydalanish yoki istalgan Xizmatdan foydalanish natijasida olishingiz mumkin bo‘lgan har qanday haqoratlovchi, qo‘rqituvchi, sha‘ningizga dog‘ tushiruvchi yoki noqonuniy xabarlar yoki o‘tkazishlar uchun javobgarlikni o‘z zimmasiga olmasligiga o‘z roziligingizni bildirasiz. \n 3.Kafolatlarning yo‘qligi \n  Siz Litsenziyalangan ilova va Xizmatlardan barcha xatarlarni o‘z zimmangizga olgan holda foydalanishingizni tan olasiz va bunga o‘z roziligingizni bildirasiz. Barcha Litsenziyalangan ilova va Xizmatlar hech qanday yaqqol ifodalangan yoki ko‘zda tutilgan kafolatlarsiz \"shundayligicha\" va \"mavjudligicha\" asosida taqdim etiladi. Ishlab chiqaruvchi Litsenziyalangan ilova va Xizmatlarga nisbatan hech qanday oshkora, nazarda tutiladigan yoki qonunchilikda ko‘zda tutilgan kafolatlarni, jumladan tijoriy qimmatga, tegishli sifatga egaligi, ma‘lum maqsadlar uchun yaroqliligi, aniqligi, boshqalarning huquqlarining buzilmasligiga bo‘lgan kafolatlarni bermaydi. Ishlab chiqaruvchi ushbu qurilma orqali foydalanish mumkin bo‘lgan har qanday Litsenziyalangan ilova yoki Xizmatlarning aniqligi, yaroqliligi, o‘z vaqtidaliligi, qonuniyligi yoki to‘liqligiga kafolat bermaydi va Qurilma, Litsenziyalangan ilova yoki Xizmatlarning talablaringizga javob berishi yoki Litsenziyalangan ilova yoki Xizmatlarning uzluksiz yoki xatosiz ishlashi yoki Litsenziyalangan ilova yoki Xizmatlardagi nuqsonlarning tuzatib berilishi uchun hech qanday kafolat bermaydi. Litsenziyalangan ilova yoki Xizmatlar nuqsonli bo‘lar ekan, barcha zarur texnik xizmat ko‘rsatishlar, ta‘mirlash yoki tuzatish bo‘yicha barcha harajatlar sizning zimmangizda deb hisoblanadi.\nSiz Litsenziyalangan ilova va Xizmatlarning o‘zgartirilishi, to‘xtatib qo‘yilishi, olib tashlanishi, bekor qilinishi yoki uzib qo‘yilishining mumkinligi yoki kirish istalgan vaqtda avvaldan xabar qilmagan holda o‘chirib qo‘yilishi mumkinligini tan olasiz va bunga o‘z roziligingizni bildirasiz va Ishlab chiqaruvchi Litsenziyalangan ilova va Xizmatlarga kiritilgan har qanday kontent yoki xizmatning istalgan davr mobaynida mavjud bo‘lib turishi to‘g‘risida hech qanday bayonat yoki kafolat bermaydi. Bunday kontentlar va xizmatlar boshqalar tomonidan Ishlab chiqaruvchi nazorat qila olmaydigan tarmoqlar va o‘tkazish vositalari orqali o‘tkaziladi. Yuqorida bayon qilinganlarning umumiyligini cheklamagan holda Ishlab chiqaruvchi ushbu qurilma orqali foydalanish mumkin bo‘lgan har qanday kontent yoki xizmatning o‘zgartirilishi, uzib qo‘yilishi, o‘chirilishi, olib tashlanishi yoki to‘xtatib qo‘yilishi uchun har qanday javobgarlikni yoki ma‘suliyatni o‘z zimmasiga olishni yaqqol tarzda rad qiladi. Ilova ta‘minotchisi yoki Xizmatlarning boshqa ta‘minotchilari har qanday Litsenziyalangan ilova yoki Xizmatni istalgan vaqtda hech qanday bildirishlarsiz o‘zgartirish, to‘xtatib qo‘yish, olib tashlash yoki o‘chirib qo‘yish huquqini o‘zlarida saqlab qoladilar. Ishlab chiqaruvchi ham har qanday sabab bilan va avvaldan xabar bermasdan yoki javobgarliksiz ma‘lum Litsenziyalangan ilova yoki xizmatlardan foydalanish yoki kirishni cheklab qo‘yishi mumkin.\nIshlab chiqaruvchi Litsenziyalangan ilova yoki xizmatlar bilan bog‘liq bo‘lgan mijozlarga xizmat ko‘rsatish bo‘yicha mas‘uliyatni hamda javobgarlikni o‘z zimmasiga olmaydi. Litsenziyalangan ilova va xizmatlar bilan bog‘liq bo‘lgan har qanday xizmat uchun har qanday savol yoki talab bevosita tegishli provayderga berilishi kerak.\n 4.Ma‘lumotlarning to‘planaishi va ulardan foydalanish\nSiz Ishlab chiqaruvchi, Ilova ta‘minotchilari va Xizmatlar ta‘minotchilarining texnik ma‘lumotlar va boshqa tegishli ma‘lumotlarni, jumladan bu Qurilma, tizim va ilova dasturiy ta‘minoti va periferik qurilmalar to‘g‘risidagi texnik ma‘lumotlarni dasturiy ta‘minot yangilanishlari, mahsulotni qo‘llab-quvvatlash xizmatlari va Qurilma va Litsenziyalangan ilovaga bog‘liq bo‘lgan boshqa xizmatlarni (agar shundaylar mavjud bo‘lsa) taqdim etishga imkon berish uchun to‘plashlari va ulardan foydalanishlari mumkinligiga o‘z roziligingizni bildirasiz. Bunday ma‘lumotlar shaxsan sizni tanib olishga imkon bermas ekan, Ishlab chiqaruvchi, Ilova ta‘minotchilari va Xizmatlarning ta‘minotchilari o‘z mahsulotlarini yaxshilash yoki sizga xizmatlar yoki texnologiyalarni taqdim etish uchun bunday ma‘lumotlardan foydalanishlari mumkin. \n 5.Ma‘lum xususiyatlarning mavjudligi \n Ilova ta‘minotchisining cheklanishlari tufayli ma‘lum xususiyatlar, ilovalar va xizmatlardan ushbu Qurilma (jumladan uning yordamchi qurilmalari) orqali yoki barcha hududlarda ham foydalanib bo‘lmasligi mumkin. Ushbu Qurilmadagi ayrim xususiyatlar qo‘shimcha periferik qurilmalarni yoki alohida sotiladigan a‘zolik badallarini talab qilishi mumkin. \n 6.Javobgarlikning cheklanishi \n Tegishli qonunlarda ruxsat berilgan darajada Ishlab chiqaruvchi har qanday holatda, jumladan e‘tiborsizlik holatida ham xattoki bunday zararlarning bo‘lishi mumkinligi to‘g‘risida ogohlantirilgan bo‘lsa ham siz yoki boshqa tomon tomonidan Qurilma, Litsenziyalangan ilova yoki har qanday Xizmatdan foydalanilishi natijasida yetkaziladigan bevosita, bilvosita, tasodifiy, atayin yoki boshqa tarzda yetkazilgan shikastlar yoki yuridik xizmatlarga sarflangan xarajatlar uchun javobgarlikni o‘z zimmasiga olmaydi. "];	
